import MyroomDust from "./MyroomDust";
import InsideDustState from "./InsideDustState";
import NeedofWindow from "./NeedofWindow";
import CanOpen from "./CanOpen";
import { DUMMY_DATA } from "../data.js";
import { useState } from "react";

export default function InsideDust() {

  const [seletedDust, setSelectedDust] = useState();

  function handleSelect(selectSet) {
    if (selectSet >= 0 && selectSet <= 30) {
      setSelectedDust("good");
    } else if (selectSet > 30 && selectSet <= 80) {
      setSelectedDust("average");
    } else if (selectSet > 80 && selectSet <= 150) {
      setSelectedDust("bad");
    } else if (selectSet > 150) {
      setSelectedDust("very_bad");
    }
  }

  let tabContent = 0;
  
  if (seletedDust) {
    tabContent = (
      <div>{DUMMY_DATA.dust}</div>
    );
  }

  return (
    <>
      {tabContent}
      <MyroomDust dust="33"></MyroomDust>
      <NeedofWindow></NeedofWindow>
      <CanOpen></CanOpen>
    </>
  );
}
